def BinarySquareRoot(start,end,num):
    mid=(start+end)/2
    m=mid*mid
    if abs(m-num)<0.2:
        return round(mid,15)
    elif m>num:
        mid=round(mid,15)
        return BinarySquareRoot(start,mid,num)
    else:
        mid=round(mid,15)
        return BinarySquareRoot(mid,end,num)

num=[i for i in range(0,10001)]
from datetime import datetime
Time=datetime.now()
for i in num:
    if i<6:
       print(BinarySquareRoot(0,i,i),end=' ')
    else:
        print(BinarySquareRoot(0,(i>>1),i),end=' ')
print()
diff=datetime.now()-Time
Diff=int(diff.total_seconds()*1000)
print(Diff,'Milliseconds for Binary')

